import React,{Component} from "react";
class Header extends Component{
    constructor(props){
        super(props);
        this.state = {searchKey:''}
    }
    getKeySearch=(e)=>{
        this.state.searchKey=e.target.value;
    }
    search=()=>{
        alert(this.state.searchKey)
    }
 render() {
     
        return (
            <div className="header">
                <div className="header-header">
                    <img className="" alt="Logo" src="./image/Logo.png"></img>
                </div>
                <div className="search">
                    <input className="btn_search" type="submit" defaultValue="OK" value={this.state.searchKey} onChange={this.getKeySearch}/>
                    <input className="key_search" type="text" onClick={this.search} value="Tìm kiếm"/>
                </div>
            </div>
           
        )
 }
}
export default Header;
